import React, { useState } from 'react';
import ExpensesForm from './ExpensesForm';
import './NewExpenses.css';
import './CloseForm';
import './OpenForm';
import OpenForm from './OpenForm';

function NewExpenses(props) {
	const [btnOpen, setButtonOpen] = useState();

	const clickHandler = (e) => {
		e.prevent.default();
	};

	const saveExpenseComponentData = (enteredExpenseData) => {
		const expenseData = {
			...enteredExpenseData,
			id: Math.random(),
		};
		props.onAddExpense(expenseData);
	};

	let showForm = '';

	// if (button clicked){
	// 	const showForm = <ExpensesForm onSaveExpenseData={saveExpenseComponentData} />
	// }

	return (
		<div className="new-expense">
			<ExpensesForm onSaveExpenseData={saveExpenseComponentData} />
			<button type="submit" onSubmit={clickHandler}>
				Add new car
			</button>
		</div>
	);
}

export default NewExpenses;
